    let posts_data = [
        {id: 1, message: "heyy"},
        {id: 2, message: "no"},
        {id: 3, message: "ok"},
        {id: 4, message: "the let's go"},
        {id: 5, message: "yeah that's great"},
        {id: 6, message: "welcome amazing"},
    ]
    return (<div>
        <p className={s.text}>My posts</p>
        <textarea name="" id="" cols="19" rows="7">input here</textarea>
        <button>Add a post</button>
        <button>delete a post</button>
        <My_post message="Hello Kaneki " like_count="23" dislike_count="0"/>
        <My_post message="Bye, Feral'" like_count="7" dislike_count="0"/>

    </div>)
}

export default My_posts;
